import React from 'react';

const App = () => {
  return (
    <>

      <h1 className="card-text text-center text-danger my-4">Bootstrap cards with props</h1>

      <div className="container">
        <div className="row">
          <div className="col-lg-3 my-3">

            <div className="card">
              <img src="https://thumbor.forbes.com/thumbor/fit-in/x/https://www.forbes.com/home-improvement/wp-content/uploads/2022/07/download-23.jpg" className="card-img-top" alt="house 1 img" />
              <div className="card-body">
                <h5 className="card-title">House 1</h5>
                <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                <a href="#" className="btn btn-primary">Read More</a>
              </div>
            </div>
          </div>
        </div>
      </div>

    </>
  );
};
export default App
